(1, 1, ' ', '1532175702.jpg', '<p>ROUGHLY 51 MILLION AMERICAN SENIORS LIVE IN POVERTY. HALF OF ALL PEOPLE ON MEDICARE HAVE IMCOME OF LESS THAN $26,000 PER YEAR.  PENSIONS ARE A THING OF THE PAST AND SOCIAL SECURITY JUST DOESN’T PROVIDE ENOUGH MONEY TO LIVE ON.</p>\r\n<p>FOR MOST, THEIR HOMES ARE THEIR MOST VALUED ASSETS BUT WHEN IT NEEDS REPAIRS IN ORDER TO SELL IT AT ITS BEST PRICE, FAR TOO MANY PEOPLE ARE SELLING THEIR HOME FOR PENNIES ON THE DOLLAR TO WHOLESALERS SEEKING TO TAKE THE PROFIT.</p>\r\n<p>DON\'T GIVE YOUR HOME AWAY. YOU DESERVE AS Money AS YOU CAN GET WHEN YOU SELL.</p>\r\n<p>PARTNER WITH THE AN INVESTOR AND let them renovate your home at no cost to you. IT\'S A NATURAL FIT...</p>\r\n<p>AND IT CREATES A WIN-WIN SOLUTION THAT CAN LEAVE YOU WITH MORE MONEY WHEN YOU HOME SELLS.</p>', '', '<p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n<span style=\"color: rgb(11, 42, 74);\">\r\nMy name is Tye Glover and I created the Invest Out Partnering system because too many homeowners are being taken advantage of when it comes time to sell our homes, simply because we may not have an option of making improvements ourselves.<span style=\'color:#2f9784;font-weight: bold;\'>That was exactly my situation</span> when it came time for me to sell. In 2011 I went through a divorce and was being forced to sell my 1890s Victorian for cash to an investor. Why cash? Because the home needed a lot of work, I didn’t have the money to do that renovation and it can be difficult for home buyers to get financing when the home doesn’t qualify for FHA loans.\r\n</span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">I, like many homeowners today, needed as much money from my home as possible but I knew I was at a disadvantage simply because all of the power was being held by the investor, wholesalers, and lenders. As a homeowner, I felt like had no voice or negotiating power. It wasn’t until I looked at the prospects of selling my home from a completely different perspective, that I began to recognize and embrace my true power. </span></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">\r\n<h1 class=\'text-center\'>\r\n	<span style=\'color:#5E17B4;font-weight: bold;font-size:18px;\'>My home itself\r\n		<br><br>	                 \r\n	</span>\r\n</h1>\r\n</span></span></p>\r\n<p class=\'text-center\'>\r\n<span class=\"container-fluid\">\r\n	<img style=\"background-size: cover\" src=\"cms/SellerContent2.jpg\" alt=\"My home itself\" align=\"middle\"> \r\n</span>\r\n</p>\r\n<br>\r\n<br>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\"><span style=\'color:#2f9784;font-weight: bold;\'>The two things </span>investors want most are a steady supply of good homes, and strong profits. I began to understand that if homeowners were to work directly with investors, there would be no need for those investors to:\r\n</span></span></p>\r\n<br>\r\n<ul style=\"margin-bottom:0in;margin-top:0in;\" type=\"disc\">\r\n<li style=a\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;color:black;vertical-align: baseline;\"><span style=\"font-family:&quot;Arial&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\">borrow from lenders to purchase the home or </span></span></li>\r\n<li style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;color:black;vertical-align: baseline;\"><span style=\"font-family:&quot;Arial&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\">get properties from wholesalers, </span></span></li>\r\n</ul>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">… which means the homeowners and investors both make strong profits by removing the middle men. By Partnering with an investor, you can also have the most impactful improvements done to your home to dramatically improve its value.</span></span></p>\r\n<p>\r\n<h1 class=\'text-center\'>\r\n	<span style=\'color:#5E17B4;font-weight: bold;font-size:18px;\'>What’s the alternative?\r\n	<br><br>\r\n	<div class=\"col-lg-12 col-sm-6 col-xs-6\" id=\"ab-alternative\">\r\n		<img src=\"cms/SellerContent3.jpg\" alt=\"My home itself\" align=\"middle\">  \r\n	</div>	\r\n	</span>\r\n</h1>\r\n<br>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">If you try to sell your home for cash to a wholesaler, including any number of the new companies offering home purchase services like Home Lite, Zillow, Home Investors, etc., then they’ll:</span></span></p>\r\n<p>\r\n<ol style=\"margin-bottom:0in;margin-top:0in\" type=\"1\">\r\n	<li style=\"margin-left:0.15in;font-size:32px;color:#2f9784;line-height:20px;\">O<span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">ffer you less than 70% of what the home could be worth, minus the cost of the repairs. Next, they will turn around and sell your home to an investor for a profit and next,</span></span></li>\r\n	<br>\r\n	<li style=\"margin-left:0.15in;font-size:32px;color:#2f9784;line-height:20px;\">T<span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">hat investor will renovate your home to maximize its sale price, only to sell it at that maximum value for a strong profit.</span></span></li>\r\n</ol>\r\n</p>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n	<span style=\"font-size:24px;color:#2f9784;\">Why not remove step 1 </span><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">and work directly with that investor so that when the home does sell, you still get the money offered in step 1 plus a negotiated share of the increased value, without having to put any money out of your own pocket for that increased profit. </span></span>\r\n</p>\r\n<br>\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:&quot;Calibri&quot;,sans-serif;\">\r\n<span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">It’s your home and you deserve as much money as you can get when it sells.</span></span>\r\n</p>\r\n<br>\r\n<div class=\"col-lg-12 col-sm-6 col-xs-6\" id=\"ab-sign\">\r\n<img src=\"cms/TyeGlover.jpg\" alt=\"Tye Glover\" align=\"middle\"> \r\n</div>\r\n   \r\n', 'SellerContent1.jpg', '2018-07-13 14:02:35', '2019-07-25 18:13:11'),
