(3, 3, ' ', 'Cover-contact.jpg', 'GET VALUE FOR MONEY BY INVESTING IN HOMES <br/> Homes that Can Get a Much Better Price with  Some INVESTMENT. <br/> INVESTOUT HELPS YOU MAXIMIZE VALUE FOR INVESTMENTS.', 'ABOUT THE INVESTOR', '<p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"font-weight:bold\">TWO</span> of the most difficult parts of fix and flip investing when it comes to growing your business are finding investible properties and getting the money necessary to pull more and more homes into the renovation pipeline. The traditional way investors find  homes is through wholesalers and by pushing out advertisements to potential sellers in hope that their need to sell is recognized or considered around the same time your advertising is being considered by the potential homeowner. If the timing is off than your service and the homeowners needs won\'t be aligned and the homeowner may find someone else when they are ready to move forward with the sale. Also, in total there just aren\'t enough homes available to truly scale your business. \r\n</span></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">There were <span style=\'color:#2f9784;font-weight: bold;\'>only 220,000 homes flipped</span> in 2018... by <span style=\'color:#2f9784;font-weight: bold;\'>138,000 investors.</span> That\'s only about 1.6 homes per investor which again shows that it\'s nearly impossible to scale with such a small market size. \r\n</span></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\"><span style=\'color:#2f9784;font-weight: bold;\'>Consider additionally</span> the money that\'s needed to scale when you have to both buy and renovate the home. If for example you want to fix and flip 5 homes a month than you will continuously need a minimum of 5 homes in your pipeline at each phase of the Analyze, Buy, Renovate, Sell or about 20 homes each month. You have to have financing for the 5 you are buying, financing for ones being renovated, and again for the 5 or more that are up for sale. That\'s financing to cover potentially 20 homes at one time with a monthly payment each month plus all of the other cost associated with the purchase. This doesn’t even include the cost of the labor and materials associated with eh renovations.\r\n</span></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">InvestOut connects investors with property owners and oversees the process from initial inquiry to contracts to sale. Investors and homeowners share the increased profits their improvements generate. We facilitate all aspects of the collaboration from the evaluation of the property and seller to managing the transfer of capital and profits during the final transfer of title, and after the sale of the property.</span></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">Investors are able to review a curated listing of available properties on the InvestOut website. We carefully vet properties and their owners and accept only homes we believe will sell well and return high profits with renovations.</span></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><br></span></p><p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">With the Partnering Model your capital outlay is directed solely towards the money required for the material and labor to perform the renovation*. It’s that simple. Why would anyone pay for the short term ownership of the \r\n</span></span></p>\r\n<br><br>\r\n<p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;font-size:15px;font-family:\"Calibri\",sans-serif;\'><span style=\"color: rgb(11, 42, 74);\"><span style=\"font-family: Arial, sans-serif;\">* Additional cost may exist depending on how you’ve negotiated the Partnership. \r\n</span></span></p>', 'investor-about-img.jpg', '2018-07-13 14:02:35', '2019-05-09 22:39:48');
